import ExpenseItem from "./components/ExpenseItem";

function App() {
    const expanses = [
        {
            id: 'e1',
            title: 'Car Insurance',
            amount: 265.97,
            date: new Date()
        },
        {
            id: 'e2',
            title: 'Toilet Paper',
            amount: 10.27,
            date: new Date()
        }
    ]
  return (
    <div>
      <h2>Let's get started!</h2>
        <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
